import io from 'socket.io-client';
import * as dotenv from 'dotenv';
dotenv.config();

export default class Socket {
  constructor() {
    this.socket = io("http://localhost:3000", {
      transports: ["websocket"],
    });
  }

  get() {
    console.log(this.socket);
    return true;
  }
}
